import { combineReducers } from "redux";
import postReducer from "./postReducer"; //import reducer
import usersReducer from "./usersReducer";

/*export all reducers by default all combined reducers
export default combineReducers({
  dummy: () => 10, //dummy reducer to prevent errors
});*/

//take reducer put it inside to combineReducers
export default combineReducers({
  posts: postReducer,
  users: usersReducer,
});
